  @override
  Widget build(BuildContext context) {
    return const Scaffold(
      body: StackWithClipPath(),
    );
  }
}

const imageUrl =
    'data:image/jpeg;base64,';

class StackWithClipPath extends StatelessWidget {
  const StackWithClipPath({Key? key});

  @override
  Widget build(BuildContext context) {
    return Stack(
      children: [
        Image.network('https://placekitten.com/2000/3000'),
        ClipPath(
          clipper: _CropAreaClipper(),
          child: Container(
            width: double.infinity,
            height: double.infinity,
            color: Colors.red,
          ),
        ),
      ],
    );
  }
}

class _CropAreaClipper extends CustomClipper<Path> {
  @override
  Path getClip(Size size) {
    const left = 60.0;
    const top = 200.0;
    const right = 300.0;
    const bottom = 300.0;
    return Path()
      ..addPath(
        Path()
          ..moveTo(left, top)
          ..lineTo(right, top)
          ..lineTo(right, bottom)
          ..lineTo(left, bottom)
          ..close(),
        Offset.zero,
      )
      ..addRect(Rect.fromLTWH(0.0, 0.0, size.width, size.height))
      ..fillType = PathFillType.evenOdd;
  }

  @override
  bool shouldReclip(CustomClipper<Path> oldClipper) => true;
}
